        public FormPrincipal()
        {
            InitializeComponent();
            
            IniciarEscaner();
            IniciarSonido();

            if (Util.GetSetting("ConnectAtStart").Equals("true"))
            {
                Datos.CargarPalesDeBd();
            }
        }

        private void FormPrincipal_Activated(object sender, EventArgs e)
        {
            // Ponemos la barra de carga
            Cursor.Current = Cursors.WaitCursor;

            _scanContinuous = Util.GetSetting("ScanContinuous").Equals("true");
            if (_myScanApi.Barcode2 != null) _myScanApi.StartScan(_scanContinuous);

            RefrescarInterfaz(true);

            // Ocultamos la barra de carga
            Cursor.Current = Cursors.Default;
        }

        /// <summary>
        /// Se encarga de recargar los datos de todos los elementos de la interfaz
        /// </summary>
        /// <param name="rellenarCombo">true para que vuelva a cargar los datos del combobox</param>
        private void RefrescarInterfaz(bool rellenarCombo)
        {
            if (rellenarCombo)
            {
                comboBoxPales.DataSource = Datos.ObtenerPales();
                if (comboBoxPales.Items.Count > 0) comboBoxPales.SelectedIndex = 0;
            }

            labelLectura.Text = "";
            var numBarcodes = Datos.ContarBarcodes();
            labelCola.Text = numBarcodes.ToString(CultureInfo.InvariantCulture);
            buttonEnviar.Enabled = (numBarcodes > 0);
        }

        private void menuItemOpciones_Click(object sender, EventArgs e)
        {
            if (_myScanApi.Barcode2 != null) _myScanApi.StopScan();
            using (var formularioConfig = new FormConfiguracion())
            {
                formularioConfig.ShowDialog();
            }        
        }

        private void buttonEnviar_Click(object sender, EventArgs e)
        {
            // Ponemos la barra de carga
            Cursor.Current = Cursors.WaitCursor;

            try
            {
                if (Util.GetSetting("SendByFtp").Equals("true"))
                {
                    Datos.EnviarBarcodesFtp(ftpConnection_Uploaded, comboBoxPales.Text);
                }
                else
                {
                    Datos.EnviarBarcodesBd();
                    // Vamos a recargar la lista de palés, porque si ya no tienen cajas pendientes, no tiene sentido que se muestren en el combobox
                    Datos.CargarPalesDeBd();
                    RefrescarInterfaz(true);
                    Util.CrearNotificacion("<b>Envío correcto</b>", "OK");
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show(ex.Message, "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand,
                    MessageBoxDefaultButton.Button1);
                Util.EscribirLog(ex.Message);
            }

            // Ocultamos la barra de carga
            Cursor.Current = Cursors.Default;
        }

        private void menuItemSalir_Click(object sender, EventArgs e)
        {
            var result = MessageBox.Show("¿Desea salir de la aplicación?", "Salir", MessageBoxButtons.YesNo,
                MessageBoxIcon.None, MessageBoxDefaultButton.Button1);

            if (!result.Equals(DialogResult.Yes)) return;
            try
            {
                if(_myScanApi.Barcode2 != null) _myScanApi.TermBarcode();
                _myAudioController.Dispose();
            }
            catch{}
            finally
            {
                Application.Exit();
            }
        }

        private void ComprobarResultado(int resultado, string cCodBar)
        {
            switch (resultado)
            {
                case Result.ERROR_NUM_LOTES:
                    Util.EscribirLog("ERROR, Nº de lotes inválido: " + cCodBar);
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_LONG_COD:
                    Util.EscribirLog("ERROR, Longitud código inválida: " + cCodBar);
                    labelLectura.Text = "ERROR, longitud inválida";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_FORM_COD:
                    Util.EscribirLog("Formato de código no soportado: " + cCodBar);
                    labelLectura.Text = "ERROR, formato inválido";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.OK:
                    Util.BeepOk(_myAudioController);
                    labelLectura.Text = "OK";
                    break;

                case Result.ERROR_CAJA_EXISTE:
                    Util.EscribirLog("ERROR, la caja ya existe");
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_LOTE_EXISTE:
                    Util.EscribirLog("ERROR, el palet no existe: " + cCodBar);
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_PALET_EXISTE:
                    Util.EscribirLog("ERROR, el lote ya existe: " + cCodBar);
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_CAJA_NO_EXISTE:
                    Util.EscribirLog("ERROR, la caja no existe: " + cCodBar);
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_COD_DUP:
                    Util.EscribirLog("ERROR, código duplicado: " + cCodBar);
                    labelLectura.Text = "ERROR, código duplicado";
                    Util.BeepError(_myAudioController);
                    break;

                case Result.ERROR_PALE_O_COD_NULL:
                    Util.EscribirLog("ERROR, palé o código nulos: " + cCodBar);
                    labelLectura.Text = "ERROR";
                    Util.BeepError(_myAudioController);
                    break;

                default:
                    Util.EscribirLog("Error indeterminado procesando código: " + cCodBar);
                    labelLectura.Text = "ERROR indeterminado";
                    Util.BeepError(_myAudioController);
                    break;
            }

            labelLectura.ForeColor = resultado != Result.OK ? Color.Red : Color.Green;
        }

