        #region Métodos para controlar el escáner

        private void IniciarSonido()
        {
            _myAudioController = null;

            // Emulador sin simulación de audio activada
            if (Symbol.Audio.Device.AvailableDevices.Length == 1 && _myScanApi.Barcode2 == null) return;
            
            //Select Device from device list (Simulado/Standard)
            var myDevice = (_myScanApi.Barcode2 != null) ? Symbol.Audio.Device.AvailableDevices[0] : Symbol.Audio.Device.AvailableDevices[1];

            //check the device type
            switch (myDevice.AudioType)
            {
                case Symbol.Audio.AudioType.StandardAudio:
                    _myAudioController = new Symbol.Audio.StandardAudio(myDevice);
                    break;

                case Symbol.Audio.AudioType.SimulatedAudio:
                    _myAudioController = new Symbol.Audio.SimulatedAudio(myDevice);
                    break;

                default:
                    Util.CrearNotificacion("No se ha encontrado ningún dispositivo de audio", "Aviso");
                    break;
            }
        }
        
        private void IniciarEscaner()
        {
            // Initialize the ScanSampleAPI reference.
            _myScanApi = new Scanner();
            _scanContinuous = Util.GetSetting("ScanContinuous").Equals("true");
            
            if (_myScanApi.InitBarcode()) // If the Barcode object has been initialized
            {
                _myScanApi.ConfigurarEscaner();

                // Clear the statusbar where subsequent status information would be displayed.
                labelReaderStatus.Text = "";

                // Attach a scan notification handler.
                _myScanNotifyHandler = myBarcode2_ScanNotify;
                _myScanApi.AttachScanNotify(_myScanNotifyHandler);

                // Attach a status notification handler.
                _myStatusNotifyHandler = myBarcode2_StatusNotify;
                _myScanApi.AttachStatusNotify(_myStatusNotifyHandler);
            }
        }

        /// <summary>
        ///     Handle data from the scan. Used in the scan mode.
        /// </summary>
        private void HandleData(ScanData scanData)
        {
            if (string.IsNullOrEmpty(comboBoxPales.Text)) return;

            var resultado = Datos.ProcesarBarcode(comboBoxPales.Text, scanData.Text);
            RefrescarInterfaz(false);
            ComprobarResultado(resultado, scanData.Text);
        }

        private void HandleContinuousData(ScanData scanData)
        {
            if (string.IsNullOrEmpty(comboBoxPales.Text)) return;

            var resultado = Datos.ProcesarBarcode(comboBoxPales.Text, scanData.Text);
            RefrescarInterfaz(false);
            ComprobarResultado(resultado, scanData.Text);
        }

        /// <summary>
        /// Read notification handler.
        /// </summary>
        private void myBarcode2_ScanNotify(ScanDataCollection scanDataCollection)
        {
            // Get ScanData
            var scanData = scanDataCollection.GetFirst;

            switch (scanData.Result)
            {
                case Results.SUCCESS:

                    labelReaderStatus.Text = "OK";

                    // Handle the data from this read & submit the next read.
                    if (_scanContinuous)
                    {
                        HandleContinuousData(scanData);
                        _myScanApi.StartScan(true);
                    }
                    else
                    {
                        HandleData(scanData);
                        _myScanApi.StartScan(false);
                    }

                    break;

                case Results.E_SCN_READTIMEOUT:
                    labelReaderStatus.Text = "TimeOut";
                    _myScanApi.StartScan(_scanContinuous);
                    break;

                case Results.CANCELED:
                    labelReaderStatus.Text = "Cancelado";
                    break;

                case Results.E_SCN_DEVICEFAILURE:

                    _myScanApi.StopScan();
                    _myScanApi.StartScan(_scanContinuous);
                    break;

                default:

                    var sMsg = "La lectura falló\n"
                                  + "Resultado = "
                                  + (scanData.Result);

                    labelReaderStatus.Text = sMsg;

                    if (scanData.Result == Results.E_SCN_READINCOMPATIBLE)
                    {
                        // If the failure is E_SCN_READINCOMPATIBLE, exit the application.
                        MessageBox.Show("Error escáner incompatible. Se saldrá de la aplicación", "Error");
                        Close();
                    }

                    break;
            }
        }

        /// <summary>
        ///     Status notification handler.
        /// </summary>
        private void myBarcode2_StatusNotify(StatusData statusData)
        {
            switch (statusData.State)
            {
                case States.IDLE:
                    labelReaderStatus.Text = _scanContinuous ? "Apriete el gatillo para escanear" : "Apunte al código para escanear";
                    break;

                case States.READY:
                    labelReaderStatus.Text = "Apunte al código para escanear";
                    break;

                default:
                    labelReaderStatus.Text = statusData.Text;
                    break;
            }
        }

        #endregion

        /// <summary>
        /// Evento que se lanza cuando se ha subido un archivo al ftp
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void ftpConnection_Uploaded(object sender, FTPFileTransferEventArgs e)
        {
            if (e.Succeeded)
            {
                Util.CrearNotificacion("<b>Envío correcto</b>", "OK");
                Datos.EliminarBarcodes();
                RefrescarInterfaz(false);
            }
            else
            {
                MessageBox.Show("Error enviando archivo. Vuelva a intentarlo.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand, MessageBoxDefaultButton.Button1);
            }
        } 

